FORTIFY BOOK 

The Fortify book has the power to help you change your life. In the book, you will learn more about addiction, the details on how pornography hurts society, and how to begin recovery with personal strategies that you build for yourself!

The problem of pornography in society has never been worse. With easy access to the most extreme pornographic material at the tip of our fingers, we are all facing something that our parents never did. In the palm of our hand we can be exposed to images, messages, and ideas that cripple our minds and distort our very nature. 

FORTIFY was specifically designed to help young people facing an addiction to pornography reach long lasting freedom. In this book you will find the tools, education, and resources necessary to help you or someone you love overcome this addiction.
